// 场景配置文件

// 场景编号规则：章节+序号
// 编号规则范围：主城（1~20），战场（21~50），测试地图（51~99）,副本（100~）
// 副本每5个一组代表5个难度：科拉姆尔：简单-120，普通-121，困难-122，王者-123，英雄-124
// 第一章副本编号：【100,101,102,103,104】【105,106,107,108,109】.....
// 第二章副本编号：【200,201,202,203,204】【205,206,207,208,209】.....
